import React from 'react';

import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

import AccessAlarmIcon from '@material-ui/icons/AccessAlarm';

import './../style/ImageUpload.css';

export default () => {
    const testImage =
        'https://assets.flatpyramid.com/wp-content/uploads/2017/09/11223302/squidward-lula-molusco-3d-model-263482.jpg';

    const images = [testImage, testImage, testImage];

    function image(i) {
        if (i <= images.length - 1) {
            return <img src={images[i]} alt='upload' className='image' />;
        } else {
            return (
                <div className='image-placeholder'>
                    <AccessAlarmIcon width='20px' />
                </div>
            );
        }
    }
    return (
        <Container>
            <Row className='pb-2'>
                <Col>
                    {image(0)}
                    {/* <img
                        src='https://assets.flatpyramid.com/wp-content/uploads/2017/09/11223302/squidward-lula-molusco-3d-model-263482.jpg'
                        alt='upload'
                        className='image-placeholder large-holder'
                    /> */}
                </Col>
            </Row>
            <Row className='pb-2'>
                <Col className='pr-1'>
                    {/* <img
                        src='https://assets.flatpyramid.com/wp-content/uploads/2017/09/11223302/squidward-lula-molusco-3d-model-263482.jpg'
                        alt='upload'
                        className='image-placeholder large-holder'
                    /> */}
                    {image(1)}
                </Col>
                <Col className='pl-2'>
                    {/* <img
                        src='https://assets.flatpyramid.com/wp-content/uploads/2017/09/11223302/squidward-lula-molusco-3d-model-263482.jpg'
                        alt='upload'
                        className='image-placeholder large-holder'
                    /> */}
                    {image(2)}
                </Col>
            </Row>
            <Row className='pb-2'>
                <Col className='pr-1'>
                    {/* <img
                        src='https://assets.flatpyramid.com/wp-content/uploads/2017/09/11223302/squidward-lula-molusco-3d-model-263482.jpg'
                        alt='upload'
                        className='image-placeholder large-holder'
                    /> */}
                    {image(3)}
                </Col>
                <Col className='pl-1'>
                    {/* <img
                        src='https://assets.flatpyramid.com/wp-content/uploads/2017/09/11223302/squidward-lula-molusco-3d-model-263482.jpg'
                        alt='upload'
                        className='image-placeholder large-holder'
                    /> */}
                    {image(4)}
                </Col>
            </Row>
        </Container>
    );
};
